%[text] # SLICER Volume Analysis - CTACardio Segmentations
%[text] In this exercise, we compare the segmentations generated by the different segmentation techniques in Slicer.
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] 
%[text] ## Set Folder Path
%[text] 1. Select your CTACardio Folder
%[text] 2. Update the paths to match the names that you set for your project
%[text] 3. Review the path check (there should be no zeros) \
close all
clearvars
paths.project = "/Users/ernesto/MATLAB-Drive/MtMdata/unit3/CTACardio"; %[control:filebrowser:3ae0]{"position":[17,70]}
ls(paths.project) % display folder contents %[output:5f1a48a8]
paths.intensity = fullfile(paths.project,"CTACardio Crop.nrrd");
paths.segment = fullfile(paths.project,"Salcedo Segmentation.seg.nrrd");
paths.total = fullfile(paths.project,"CTACardio Crop segmentation.seg.nrrd");
%[text] path check
table(fieldnames(paths),structfun(@(x) exist(x,"file"),paths),VariableNames=["path" "X"]) % make sure paths exist  %[output:2f156ce7]
%[text] - a zero in the table means the indicated file path does not exist  \
%%
%[text] ## Load Segmentations
intMV = medicalVolume(paths.intensity); % intensity volume
myMV = medicalVolume(paths.segment) % my kidney and aorta segmentations %[output:4d534e1c] %[output:21d4a7d6]
totalMV = medicalVolume(paths.total) % totalsegmentator segmentations %[output:90c21be3] %[output:6a9ab3f3]
%%
%[text] ### Get slicer tables
%[text] These tables contain the information that you set in Slicer (Segmentation Name and Color)
myT = mmGetSlicerSegTable(paths.segment) %[output:6201817c]
totT = mmGetSlicerSegTable(paths.total) %[output:78157678]
%%
%[text] ### Index out a Kidney and Compare
%[text] The function **`mmGetMedicalVolumeSegment`** indexes out the indicated segment and returns a structure containing the mask, the color, and the transformation matrix.
segName = "right kidney" %[output:6aebacf9]
mySeg = mmGetMedicalVolumeSegment(myMV,myT,segName=segName) %[output:933e6774]
totSeg = mmGetMedicalVolumeSegment(totalMV,totT,segName=segName) %[output:36aa9994]
%%
%[text] ### Compare Kidneys
%[text] Notice that the volumes appear to different. If we can calculate a ratio between the two volumes
mySeg.volume/totSeg.volume % ratio of volumes %[output:2f383634]
%[text] - we find the volumes are significantly different \
%%
%[text] We can use also use [dice](https://en.wikipedia.org/wiki/Dice-S%C3%B8rensen_coefficient) and jaccard to gauge the similarity of two segmentations. 
dice(mySeg.mask,totSeg.mask) %[output:61d7d613]
jaccard(mySeg.mask,totSeg.mask) %[output:4391927e]
%[text] - These are relatively low values for similarity, so there is quite a bit of difference between the volumes
%[text] - What's going on? \
%%
%[text] ## Review Slice Planes and segmentation
%[text] We can use **`volshow`** to review our segmentations. Here we plot my segmentations as volume renders and the total segmentations as slice planes
hvr = viewer3d(parent=uifigure,BackgroundColor="white",BackgroundGradient="off",CameraZoom=1); % set background color to white and turn off gradient
volshow(myMV,Parent=hvr) % display my segmentation as a volume render
volshow(intMV,parent= hvr,RenderingStyle="SlicePlanes",OverlayData=totalMV.Voxels) % display total segmentation as slice planes
%%
%[text] ### Plot Kidneys as surfaces
%[text] We can also plot the segmentations as surfaces so we can better gauge where the differences might be
%[text] The function **`mmPlotMask2Surface`** plots masks as 3D Surfaces. We had patch handles (hp) to the segmentation structure
figure; %[output:1b5b2a9b]
mySeg.hp =  mmPlotMask2Surface(mySeg.mask,fcolor='m'); %[output:1b5b2a9b]
totSeg.hp = mmPlotMask2Surface(totSeg.mask,fcolor='cyan',smooth=false); %[output:1b5b2a9b]
%%
%[text] ### Compare surfaces used Hausdorff distance
%[text] A measurement of the summed difference between the two surfaces
robustHD(mySeg.hp.Vertices,totSeg.hp.Vertices,5,'euclidean') % calculate difference between surfaces %[output:0ffe66cf]
%[text] - myPatch and totPatch are handles to the plotted surfaces.
%[text] - Try turning on smooth for the total patch
%[text] - The total segmentator volume looks larger than my segmentation, but not that much larger
%[text] - My segmentation does not have the medulla segmented  \
%%
%[text] ### Plot Kidneys using volshow
%[text] If we plot each kidney using volshow, we can use the volshow tools to slice the kidney and inspect the interior. We are going to use a different figure call, **`uifigure,`** so we can place our figures in the same figure. After the volumes are displayed:
%[text] -  add a clipping plane and clip both volumes: \
mmVolShowPair(totSeg,mySeg,"Kidney Compare")
%[text] - So, as we can see, my kidney is riddled with holes (the medulla), while the total segmentator is more whole — this is why the volumes differ. \
%%
volshow(totSeg.mask)
volshow(mySeg.mask)
%%
%[text] #### Use Scissors tool to remove vasculature
%[text] 1. Use the scissors to clip off the vasculature from my kidney
%[text] 2. When you are done, right click on the kidney, and select export scissor mask to workspace
%[text] 3. Export as `scissorsMask`  \
mySeg.maskCut = mySeg.mask;
mySeg.maskCut(scissorsMask) = false; % remove vasculature voxels from kidney mask
%%
%[text] #### Can we fill the holes?
mySeg.fill = imfill(mySeg.maskCut,26,"holes");
%%
volshow(mySeg.fill)
%[text] - holes can't be filled because of opening through surface \
%%
%[text] ### Calculate volume using Convex Hull
%[text] A convex hull is like shrink wrap for your volume. We can use convex hull to capture the internal volume of our segmentation, as follows:
rp = regionprops3(mySeg.maskCut,["Volume", "ConvexVolume","ConvexImage","ConvexHull","Image"]) %[output:3ed16070]
%[text] Here, regionprops3 returns:
%[text] - **two scalars:** `volume` and  `convexVolume`
%[text] - **two volumes**: `Image` and `ConvexImage`
%[text] - **one vertices set**`: ConvexHull surface` \
%[text] Notice that the convexVolume is larger than the Volume
%%
%[text] #### Visualize the convex hull volume
volshow(rp.ConvexImage{1})
%[text] - doesn't look especially kidney-like \
%%
%[text] #### Overlay Image and ConvexImage as surfaces
%[text] Notice here we are plotting the volumes `rp.Image` and `rp.ConvexImage`, captured by Region Props. These are cropped volumes that contain just the kidney. 
figure; %[output:2ef4558a]
mmPlotMask2Surface(rp.Image{:},fcolor='m'); %[output:2ef4558a]
mmPlotMask2Surface(rp.ConvexImage{:},fcolor='cyan',smooth=false); %[output:2ef4558a]
%[text] - The kidney is in there
%[text] - But the hull is not a good representation of the kidney Shape \
%%
%[text] ### Calculate Volume from surface using AlphaShape
%[text] An alphaShape is similar to convex hull, but it can be more representative of the surface shape. We generate alphaShapes from vertices, so we first need to plot the kidney as a surface:
figure; %[output:6b2524a8]
mySeg.hp = mmPlotMask2Surface(mySeg.maskCut,fcolor='m'); %[output:6b2524a8]
%[text] 
%%
%[text] #### Generate alphaShape
%[text] here we use the function `alphaShape` to generate the shape
ashp = alphaShape(mySeg.hp.Vertices,5) %[output:965e0c4a]
%[text] - The function returns an alphaShape object
%[text] - The object contains a set of vertices that represents the exterior surface of the object \
%%
%[text] ### Plot alphaShape
%[text] we use the function `plot` to plot the alphaShape
figure %[output:5206e9da]
hashp = plot(ashp,"FaceColor",'c',"EdgeAlpha",0.5); %[output:5206e9da]
%[text] - notice there are no holes in our surface (very important when calculating volume) \
%%
%[text] #### Overlay alphaShape and original volume
hashp.FaceAlpha = 0.5; % increase alphaShape transparency %[output:3b06c6ce]
mmPlotMask2Surface(mySeg.maskCut,fcolor='m'); %[output:3b06c6ce]
%[text] - better shape representation \
%[text] 
%%
%[text] #### Compare volumes
%[text] An alphaShape has the volume automatically calculated. 
ashp.volume  %[output:8ce48bd1]
ashp.volume/totSeg.volume % volume ratios %[output:3d3ca22d]
%[text] - volume closer to totalSegmentator volume \
%%
figure %[output:9865a76e]
plot(ashp,"FaceColor",'c',EdgeAlpha=0.5,FaceAlpha=0.5); %[output:9865a76e]
mmPlotMask2Surface(totSeg.mask,fcolor='m'); %[output:9865a76e]
%[text] - These shapes look comparable
%[text] - totalSegmentator larger than my segmentation.  \
%%
%[text] ## Compare Aorta
%[text] Next we compare our aorta to the total segmentator one
close all hidden % close uifigures
segName = "aorta";
mySeg = mmGetMedicalVolumeSegment(myMV,myT,segName=segName);
totSeg = mmGetMedicalVolumeSegment(totalMV,totT,segName=segName);
%%
mmVolShowPair(mySeg,totSeg,"Aortas in Space") % display segmentations side by side
%[text] - Our segmentation looks much nicer than the lego-ass one created by the total segmentator. This is because we used the fast segmentation (because we don't got all day).
%[text] - But how accurate, shape wise, is our segmentation? \
%%
volshow(mySeg.mask) %[output:817de93e]
volshow(totSeg.mask) %[output:2193d2ed]
%%
%[text] ### Overlay surfaces
%[text] Here we overlay the two segmentations
figure; %[output:993a8f05]
mySeg.hp =  mmPlotMask2Surface(mySeg.mask,fcolor='m'); %[output:993a8f05]
totSeg.hp = mmPlotMask2Surface(totSeg.mask,fcolor='cyan',smooth=true); %[output:993a8f05]
%[text] - For a better comparison, we should remove any inadvertent offshoots off our aorta \
%%
%[text] ### Remove vasculature
%[text] We can use our good friend, the logical operation, to remove the smaller vascular offshoots. Since the tot seg aorta doesn't have any offshoots, we can invert the logical to remove the offshoots
mySeg.maskCrop = mySeg.mask; % copy our mask
mySeg.maskCrop(~totSeg.mask) = false; % remove any mask outside the inverse of the totSeg aorta
%%
%[text] ### Display cropped volume
figure; %[output:23477fdd]
mySeg.hp =  mmPlotMask2Surface(mySeg.maskCrop,fcolor='m'); %[output:23477fdd]
totSeg.hp = mmPlotMask2Surface(totSeg.mask,fcolor='cyan',smooth=true); %[output:23477fdd]
%[text] - So the two segmentations actually pretty close.
%[text] - Sure, the tot seg aorta is longer, but this is not a contest \
%%
%[text] ### Volume comparison
%[text] We can use volume as a comparison metric. We already have a volume for the uncropped mask, so we just need a volume for the cropped mask
rp = regionprops3(mySeg.maskCrop,'Volume');
mySeg.volCrop = rp.Volume %[output:04a60680]
%%
%[text] If we compare the volumes, the tot seg volume seems to be quite a bit larger. This is likely because the extended superior end of tot seg aorta has a wide girth
mySeg.volCrop / totSeg.volume % Calculate volume ratio of cropped segment to original %[output:2c42bc10]
%%
%[text] ### Estimate the diameter of the aorta
%[text] Speaking of girth, we can estimate the diameter of the aorta along its extent by using a euclidean distance transformation (EDT) of the inverted mask. We invert the mask, so we can the distance from the edge of the aorta to its center. We then skeletonize the mask to capture the values along the central core of the distance transformation. Then we will average all of these central core values, multiply by 2, and, bam, mean diameter of the aorta.
%[text] Here we create the distance transform and the skeleton
mySeg.edt = bwdist(~mySeg.mask); % Euclidean Distance Transform
mySeg.skel = bwskel(mySeg.maskCrop,MinBranchLength=20); % create skeleton
%[text] - **`edt`** contains the distance from the edge of the aorta to its center, along the entire length of the aorta
%[text] - **`skel`** contains the voxel in the center of the aorta, along its entire length \
%%
%[text] #### Visualize EDT and skel
%[text] Here we display a cross-section of the EDT:
edt = mySeg.edt(:,:,100); % index out slice from EDT volume

figure; %[output:82c97b5a]
imshow(edt,[]) %[output:82c97b5a]
colormap("parula") %[output:82c97b5a]

xlim([129.4 151.9]) %[output:82c97b5a]
ylim([172.5 210.3]) %[output:82c97b5a]
impixelinfo %[output:82c97b5a]
%[text] - notice the value increases as you go towards the center of the cross-section \
%%
%[text] #### Overlay the skeleton on the EDT image
%[text] Remember, `skel` contains the center voxel.
skel = mySeg.skel(:,:,100); % index out from from SKEL volume
imshowpair(edt,skel) %[output:479937dd]
xlim([129.4 151.9]) %[output:479937dd]
ylim([172.5 210.3]) %[output:479937dd]
%[text] - The white pixel is the skel pixel \
%%
%[text] #### Visualize EDT as a volume
%[text] Adjust the Alpha Map as follows and use the parula colormap
%[text] ![](text:image:3057)
volumeViewer(mySeg.edt)
%[text] - you should set a gold core in the center of the volume render (these are the highest values found in the distance transform).  \
%%
%[text] #### Visualize  SKEL as a surface
%[text] Here we display the SKEL volume inside the CROP volume as surfaces
figure; %[output:6cde0333]
tiledlayout("horizontal") %[output:6cde0333]
nexttile %[output:6cde0333]
mmPlotMask2Surface(mySeg.mask,fcolor='c',falpha=0.1); %[output:6cde0333]
mmPlotMask2Surface(mySeg.skel,fcolor='m',falpha=1); %[output:6cde0333]
%%
%[text] #### Calculate the radii 
%[text] Here we capture the center values from the distance transform. Those values become the radii along the extent of the aorta
mySeg.Radii = mySeg.edt(mySeg.skel); % get radii

nexttile %[output:36e4a4e8]
plot(movmean(mySeg.Radii,10)) % plot moving mean of radius along length %[output:36e4a4e8]
ylabel("Radius (px)") %[output:36e4a4e8]
xlabel("Extent (along z-axis)") %[output:36e4a4e8]
mySeg.diameter = mean(mySeg.Radii)*2 %[output:70df02ac]
%%
%[text] ### Length of Aorta
%[text] We can calculate the length of the aorta by measuring the distance along the SKEL. First we find an endpoint on SKEL. Then we use the bwdistgeodesic function to calculate the distance from the endpoint to the other end of the skeleton
ep = bwmorph3(mySeg.skel,'endpoints'); % find an endpoint on the skeleton
D = bwdistgeodesic(mySeg.skel,ep,'quasi-euclidean');
D(isnan(D))=0;
mySeg.length = max(D(:)) %[output:604498ec]
%%
%[text] #### Visualize endpoint
%[text] We can use the volumeViewer to visualize the location of the endpoint on the skeleton. 
volumeViewer(D,single(ep))
%%
%[text] #### Calculate metrics for Total Segmentation
%[text] Calculate radius
totSeg.edt = bwdist(~totSeg.mask); % Euclidean Distance Transform
totSeg.skel = bwskel(totSeg.mask,MinBranchLength=20); % create skeleton
totSeg.R = totSeg.edt(totSeg.skel); % get radii
totSeg.diameter = mean(totSeg.R)*2;
%[text] Calculate length
ep = bwmorph3(totSeg.skel,'endpoints'); % find an endpoint on the skeleton
D = bwdistgeodesic(totSeg.skel,ep,'quasi-euclidean');
D(isnan(D))=0;
totSeg.length = max(D(:));
%[text] Display results
figure; %[output:332ed192]
tiledlayout("horizontal") %[output:332ed192]

nexttile %[output:332ed192]
mmPlotMask2Surface(totSeg.edt,fcolor='c',falpha=0.1); %[output:332ed192]
mmPlotMask2Surface(totSeg.skel,fcolor='m',falpha=1); %[output:332ed192]
title(sprintf('Length = %1.2f',totSeg.length)) %[output:332ed192]
nexttile %[output:332ed192]
plot(movmean(totSeg.R,5)) %[output:332ed192]
ylabel("radius") %[output:332ed192]
title(sprintf('Mean Diameter = %1.2f',totSeg.diameter)) %[output:332ed192]
%[text] - As expected, tot seg is longer,
%[text] - But it actually has a smaller average girth, go figure
%[text] - But the values were really close and may have been affected by the offshoot vasculature included on my aorta \

